import React from "react";
import "./styles/biggestWinsLosses.css";

const BiggestWinsLosses = ({ trades }) => {
  return (
    <div className="wins-lost">
      {trades.map((trade, index) => {
        const entryPrice = parseFloat(trade.entryPrice);
        const exitPrice = parseFloat(trade.exitPrice);
        const profit = exitPrice - entryPrice;

        return (
          <div key={index} className="card">
            <p>{trade.symbol}</p>
            <p className="menu">
              {profit >= 0
                ? `Profit: $${profit}`
                : `Loss: $${Math.abs(profit)}`}
            </p>
          </div>
        );
      })}
    </div>
  );
};

export default BiggestWinsLosses;

